import NavBar from './componentes/NavBar'
import { Route, Switch } from "react-router-dom";
import './App.css';
import { PokemonGrid } from './componentes/PokemonGrid';
import Buscar from './componentes/Buscar';
import Create from './componentes/Create';
import MyTeam from './componentes/MyTeam';





function App() {

  return (
    <> 
      <NavBar />


     <body>

     <Switch>
      <Route exact path="/pokedex/:id" >
       <h1>pokemon id</h1>
      </Route>
      <Route exact path="/">
       <Buscar />
        <PokemonGrid />
      </Route>
      <Route exact path="/create">

        <Create />
      </Route>
      <Route exact path="/team">
        <MyTeam />
      </Route>
      </Switch>
      <Route exact path="/pokedex/:id" >
       <h1>pokemon id</h1>
      </Route>
      <Route exact path="/">
        <PokemonGrid />
      </Route>



    </body> 

    </>
  );
}


export default App;
